import react from 'react'
import ContentLayout from './ContentLayout'

const TravelLayout = (props) => {
    return (
        <react.Fragment>
            <ContentLayout>
                <section>
                    <div className={cx('hero', 'travelHero')}></div>

                    {props.children}
                </section>
            </ContentLayout>
            <style jsx>{`
            .travelHero {
                background-image: url('/static/images/hero/travel.png');
                height: 600px;
            }
        `}</style>

        </react.Fragment>
    )
}

export default TravelLayout;
